'''
    @author [mst]
    @file   724_first_pivot.py
    @brief  leetcode problems series
    724. Find Pivot Index
    Given an array of integers nums, calculate the pivot index of this array.
    The pivot index is the index where the sum of all the numbers strictly to the
    left of the index is equal to the sum of all the numbers strictly to the index's right.
    Return the leftmost pivot index. If no such index exists, return -1.

    features, changelog:
    -2022.11: -submission

    @version 0.1 2022.11
'''

# naive solution: check sums for each index
# this yielded time limit exception, but is probably right. its clearly O(n^2)
class Solution0:
    def pivotIndex(self, nums: list[int]) -> int:
        if not nums:
            return -1

        sum_left = 0
        sum_right = 0

        for pivot in range(len(nums)):
            for left in nums[:pivot:]:
                sum_left = sum_left + left
            for right in nums[pivot+1::]:
                sum_right = sum_right + right

            if sum_left == sum_right: return pivot
            print(f"{sum_left=}, {pivot=}, {sum_right=}")
            sum_left = sum_right = 0

        return -1

# first sum the array elements with O(n)
# then walk each index adding left summs, substracting from overall sum and checking
# accepted: 63% T 92%S
class Solution:
    def pivotIndex(self, nums: list[int]) -> int:
        if not nums:
            return -1

        sum_all = sum(nums)
        sum_left = 0

        for pivot in range(len(nums)):
            if pivot > 0:
                sum_left = sum_left + nums[pivot-1]
            if sum_left == (sum_all-nums[pivot]-sum_left): return pivot
            # print(f"{pivot=}, {sum_left=}, right calc = {(sum_all-nums[pivot]-sum_left)}")

        return -1


